import React from 'react';
import './custom-btn.styles.scss'

const Custombtn=({children,googlesign,...otherprops})=>(
    <button className={`{googlesign} ? googlesign : (null)  custom-button`} {...otherprops}>{children.toUpperCase()}</button>
)

export default Custombtn;
